import React, { useState } from 'react';

const TableComponent = () => {
  // Sample data for demonstration
  const records = [
    { id: 1, name: 'Record 1', value: 100 },
    { id: 2, name: 'Record 2', value: 200 },
    { id: 3, name: 'Record 3', value: 300 },
  ];

  // State to track whether the records are visible
  const [showRecords, setShowRecords] = useState(false);

  return (
    <div>
      <button onClick={() => setShowRecords(!showRecords)}>
        Toggle Records
      </button>
      {showRecords && (
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Value</th>
            </tr>
          </thead>
          <tbody>
            {records.map(record => (
              <tr key={record.id}>
                <td>{record.id}</td>
                <td>{record.name}</td>
                <td>{record.value}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default TableComponent;
